import React from "react"
import i from "./../contacts.module.css"
import {ContextMenu} from "../../../../Utils/ContextMenu/ContextMenu";

const Contact = ({deleteContact, contacts, goToEditMode}) => (
        <div className={i.contactItem} onClick={goToEditMode}>
            <div className={i.name}>{contacts.name}</div>
            <div className={i.email}>{contacts.email}</div>
            <div className={i.phone}>{contacts.phoneNumber}</div>
            <div className={i.position}>{contacts.position}</div>
            <ContextMenu menu={() => <CustomMenu/>}/>
        </div>
)

export default Contact

// <button onClick={() => {deleteContact(contacts.id)}}>Delete</button>
const CustomMenu = () => {
    return (
        <ul className="menu">
            <li>Login</li>
            <li>Register</li>
            <li>Open Profile</li>
        </ul>
    )
};
